import React from 'react';
import styled from 'styled-components';
import backImage from '../../Images/menueBack/menueBack.jpg';
const MenueDiv = styled.img`
position: fixed;
min-width: 100%;
min-height: 100%;
background-size: cover;
background-position: center;
background-repeat: no-repeat;
width: 100vw;
height: 100vh;
`;

const MainDiv=styled.div`
width: 100vw;
height: 100vh;
h1{
color: white;
font-size: 50px;
}
`;
const MenueOfShop = () => {
    return (
        <MainDiv>
             <MenueDiv src={backImage} alt='../klkl'>
       </MenueDiv>
       <h1>
           The Menue
       </h1>
        </MainDiv>
      
    )
}

export default MenueOfShop
